import React from 'react';
import { Navbar, Container, Nav, NavDropdown, Button, Form, Card, Badge, Row, Col } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Register.css';

export const Register = () => {
  return (
    <div>
      <header className="App-header">

        <h1>Sign In</h1>

        <Card style={{ color: "#000" }}>
          {/* <Card.Img src= {logo} /> */}
          <Card.Body>
          <Form >
          <Form.Group>
            <Form.Label>Email Address</Form.Label>
            <Form.Control className="emailControl" type="email" placeholder="email@email.com" />
          </Form.Group>
          <Form.Group>
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Password" />
          </Form.Group>
          <Form.Group>
          {/* <Row> */}
            {/* <Col> */}
              <Button className="loginButton mt-3 btn-block" variant="primary" type="submit"> Login </Button>
            {/* </Col> */}
            {/* <Col> */}
              <Button className="loginButton mt-3 btn-block" variant="success" type="submit"> Register </Button>
            {/* </Col> */}
        {/* </Row> */}
        </Form.Group>
          </Form>
            <Card.Text>
              We fly your pets, not you.
            </Card.Text>
          </Card.Body>  
        </Card>
      </header>
    </div>
  )
}

export default Register
